import React from 'react';
import { AppBar, Toolbar, Typography, Container, Paper } from '@mui/material';
import { Person as PersonIcon, Work as WorkIcon, Code as CodeIcon, Mail as MailIcon } from '@mui/icons-material';
import './App.css';

function App() {
  return (
    <div className="App">

      <Container className="App-container">
        <Paper className="App-paper" elevation={3}>
          <section className="About">
            <Typography variant="h4">About Me</Typography>
            <Typography>
              Welcome to my portfolio! I am a passionate web developer with expertise in front-end technologies.
              Let me tell you a bit about myself...
            </Typography>
          </section>

          <section className="Projects">
            <Typography variant="h4">Projects</Typography>
            {/* Add your project components or descriptions here */}
          </section>

          <section className="Skills">
            <Typography variant="h4">Skills</Typography>
            {/* List your skills here, e.g., HTML, CSS, JavaScript, React, etc. */}
          </section>

          <section className="Contact">
            <Typography variant="h4">Contact Me</Typography>
            {/* Include your contact information or a contact form */}
          </section>
        </Paper>
      </Container>

      <footer className="App-footer">
        <Typography variant="body2">&copy; 2024 Your Name. All Rights Reserved.</Typography>
      </footer>
    </div>
  );
}

export default App;
